CREATE TABLE Architects (
    ArchitectID INT PRIMARY KEY,
    FirstName VARCHAR(50),
    LastName VARCHAR(50),
    BirthDate DATE,
    Nationality VARCHAR(50),
    Education VARCHAR(100),
    YearsOfExperience INT,
    Specialization VARCHAR(100),
    Email VARCHAR(100),
    PhoneNumber VARCHAR(16)
);

CREATE TABLE Clients (
    ClientID INT PRIMARY KEY,
    FirstName VARCHAR(50),
    LastName VARCHAR(50),
    CompanyName VARCHAR(100),
    Email VARCHAR(100),
    PhoneNumber VARCHAR(16),
    Address VARCHAR(150),
    City VARCHAR(50),
    Country VARCHAR(50),
    PostalCode VARCHAR(10)
);

CREATE TABLE Projects (
    ProjectID INT PRIMARY KEY,
    ProjectName VARCHAR(100),
    StartDate DATE,
    EndDate DATE,
    Budget DECIMAL(15, 2),
    Location VARCHAR(100),
    ArchitectID INT,
    Status VARCHAR(50),
    ClientID INT,
    FOREIGN KEY (ArchitectID) REFERENCES Architects(ArchitectID),
    FOREIGN KEY (ClientID) REFERENCES Clients(ClientID)
);

CREATE TABLE Buildings (
    BuildingID INT PRIMARY KEY,
    BuildingName VARCHAR(100),
    ProjectID INT,
    Height DECIMAL(10, 2),
    Floors INT,
    Material VARCHAR(50),
    YearCompleted INT,
    Style VARCHAR(50),
    `Usage` VARCHAR(50),
    FOREIGN KEY (ProjectID) REFERENCES Projects(ProjectID)
);

CREATE TABLE Suppliers (
    SupplierID INT PRIMARY KEY,
    SupplierName VARCHAR(100),
    ContactName VARCHAR(50),
    Email VARCHAR(100),
    PhoneNumber VARCHAR(16),
    Address VARCHAR(150),
    City VARCHAR(50),
    Country VARCHAR(50),
    PostalCode VARCHAR(10)
);

CREATE TABLE Materials (
    MaterialID INT PRIMARY KEY,
    MaterialName VARCHAR(50),
    SupplierID INT,
    CostPerUnit DECIMAL(10, 2),
    QuantityInStock INT,
    Unit VARCHAR(20),
    DeliveryTime INT,
    QualityRating INT,
    FOREIGN KEY (SupplierID) REFERENCES Suppliers(SupplierID)
);

CREATE TABLE Contracts (
    ContractID INT PRIMARY KEY,
    ProjectID INT,
    ClientID INT,
    ContractDate DATE,
    Amount DECIMAL(15, 2),
    Terms VARCHAR(255),
    Duration INT,
    PaymentSchedule VARCHAR(100),
    FOREIGN KEY (ProjectID) REFERENCES Projects(ProjectID),
    FOREIGN KEY (ClientID) REFERENCES Clients(ClientID)
);

CREATE TABLE Employees (
    EmployeeID INT PRIMARY KEY,
    FirstName VARCHAR(50),
    LastName VARCHAR(50),
    Position VARCHAR(50),
    HireDate DATE,
    Salary DECIMAL(10, 2),
    DepartmentID INT,
    Email VARCHAR(100),
    PhoneNumber VARCHAR(16)
);

CREATE TABLE Departments (
    DepartmentID INT PRIMARY KEY,
    DepartmentName VARCHAR(50),
    ManagerID INT,
    Location VARCHAR(100),
    Budget DECIMAL(15, 2),
    FOREIGN KEY (ManagerID) REFERENCES Employees(EmployeeID)
);

CREATE TABLE Equipment (
    EquipmentID INT PRIMARY KEY,
    EquipmentName VARCHAR(50),
    PurchaseDate DATE,
    Cost DECIMAL(10, 2),
    SupplierID INT,
    MaintenanceSchedule VARCHAR(100),
    Status VARCHAR(50),
    FOREIGN KEY (SupplierID) REFERENCES Suppliers(SupplierID)
);

CREATE TABLE Permits (
    PermitID INT PRIMARY KEY,
    ProjectID INT,
    PermitType VARCHAR(50),
    IssuedDate DATE,
    ExpiryDate DATE,
    IssuingAuthority VARCHAR(100),
    Status VARCHAR(50),
    FOREIGN KEY (ProjectID) REFERENCES Projects(ProjectID)
);

CREATE TABLE Inspections (
    InspectionID INT PRIMARY KEY,
    ProjectID INT,
    InspectionDate DATE,
    InspectorName VARCHAR(50),
    Result VARCHAR(50),
    Comments VARCHAR(255),
    FOREIGN KEY (ProjectID) REFERENCES Projects(ProjectID)
);

CREATE TABLE Finances (
    FinanceID INT PRIMARY KEY,
    ProjectID INT,
    TransactionDate DATE,
    Amount DECIMAL(15, 2),
    TransactionType VARCHAR(50),
    Description VARCHAR(255),
    FOREIGN KEY (ProjectID) REFERENCES Projects(ProjectID)
);

CREATE TABLE Designs (
    DesignID INT PRIMARY KEY,
    ProjectID INT,
    DesignName VARCHAR(100),
    DesignDate DATE,
    ArchitectID INT,
    Style VARCHAR(50),
    FOREIGN KEY (ProjectID) REFERENCES Projects(ProjectID),
    FOREIGN KEY (ArchitectID) REFERENCES Architects(ArchitectID)
);

CREATE TABLE Regulations (
    RegulationID INT PRIMARY KEY,
    RegulationName VARCHAR(100),
    Description VARCHAR(255),
    EffectiveDate DATE,
    ExpiryDate DATE,
    Authority VARCHAR(100)
);

CREATE TABLE Awards (
    AwardID INT PRIMARY KEY,
    ArchitectID INT,
    AwardName VARCHAR(100),
    Year INT,
    Organization VARCHAR(100),
    FOREIGN KEY (ArchitectID) REFERENCES Architects(ArchitectID)
);



















ALTER TABLE Employees ADD CONSTRAINT fk_employees_departments
FOREIGN KEY (DepartmentID) REFERENCES Departments(DepartmentID);














